import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle";
import { Alert } from "reactstrap";

function App() {
  return (
    <div className="App">
      <Alert color="warning"> Hey Pay attention!!!</Alert>
    </div>
  );
}
export default App;
